INSERT INTO `novedades` VALUES (1,'Se agrega una novedad',3,'2017-05-15 11:05:21'),(2,'licitado',4,'2017-07-18 10:26:43'),(3,'Estimado vecino, desde la fecha del reclamo se han reparado luminarias en: Bme. Mitre 185, 580, 680, Belgrano 50, por ultimo Drisaldi y Basilio Villarino. Le sugerimos en su próximo reclamo ser mas especifico con el lugar, de esta manera podremos ser mas eficientes en la respuesta. Gracias.',11,'2017-10-04 10:08:06'),(4,'prueba piloto en ejecucion',13,'2017-10-04 11:07:45'),(5,'prueba piloto en ejecución 2',13,'2017-10-04 11:08:38'),(6,'te vamos a reparar baja un cambio',13,'2017-10-04 15:43:35'),(7,'Tejsjajasdokaoahfao',19,'2017-10-04 15:54:42'),(8,'Esta es una prueba...',41,'2018-03-08 13:19:16'),(9,'la maquina estaba rota pasamos la semana que viene',41,'2018-03-08 13:19:58'),(10,'tenemos pala cargadora rota, se estima que en el transcuso del mes de mayo se soluciona',44,'2018-04-19 10:35:27'),(11,'Por su presencia en nuestra Delegación en el día de ayer, presentando Denuncia Penal, la cual solicitaba intervención del Área de Salud Mental, por tratarse de una vecina reincidente en comportamientos agresivos, Ud. fue entrevistada por la Trabajadora Social, quien dio conocimiento de la situación a la Lic. en Psicología, para intervenir en dicha problemática. Por lo expuesto anteriormente, es que Ud. recibió el informe anterior a este, derivado a quien correspondía. Gracias por su consulta.',52,'2018-04-27 23:53:15'),(12,'PRUEBE DE CORREO',43,'2018-05-07 13:01:15'),(13,'Hola .\nTe comentamos que estamos trabajando en conjunto con la policía local para proteger a nuestras mascotas. Si ves gente arrojando líquidos o residuos sospechosos en lugares públicos, seguí las siguientes recomendaciones.\n•	Mantener a tu mascota en el domicilio.\n•	Evita el contacto con algún tipo de alimento o material que se encuentre en la vía publica y que pueda ser riesgoso, tanto para las personas como para las mascotas.\n•	Llamá  enseguida a Zoonosis al (02927) 432201  int. 105 o 101',80,'2018-05-22 08:22:51'),(14,'Hola .\nTe comentamos que estamos trabajando en conjunto con la policía local para proteger a nuestras mascotas. Si ves gente arrojando líquidos o residuos sospechosos en lugares públicos, seguí las siguientes recomendaciones.\n•	Mantener a tu mascota en el domicilio.\n•	Evita el contacto con algún tipo de alimento o material que se encuentre en la vía publica y que pueda ser riesgoso, tanto para las personas como para las mascotas.\n•	Llamá  enseguida a Zoonosis al (02927) 432201  int. 105 o 101',81,'2018-05-22 08:23:14'),(15,'Hola, con respecto a las cámaras  se revisaron y no se encontraron nada extraño, siendo la mas cerca en la calle Alberdi y Avda. San Martin ya que la plaza no cuenta con cámaras.\ngracias',81,'2018-05-22 08:26:29'),(16,'Señora vecina, por inconvenientes con la maquinaria y el personal disponibles en esta semana, no se puedo realizar su reclamo. Por este motivo, la próxima semana, van a estar realizando el trabajo solicitado. Gracias.',75,'2018-05-23 12:12:49'),(17,'Señora vecina, el delegado pudo comunicarse con el dueño del terreno, quien le comentó que hace poco tiempo que lo compró, y que en estos días va a ir un agrimensor a medirlo para poder empezar a construir. Asimismo, el propietario agregó, que va a proceder a la limpieza de terreno en un corto plazo. Gracias',94,'2018-06-04 11:11:07'),(18,'Señora vecina, debido a que la máquina se encuentra en reparación, se posterga la recolección de ramas y troncos solicitada por Ud., hasta nuevo aviso. Disculpe las molestias y se le avisará cuando la máquina pueda pasar. Gracias',95,'2018-06-06 09:23:45'),(19,'Señora vecina, cuando se culminen las lluvias, van a pasar por su domicilio a recolectar las ramas. Gracias.',95,'2018-06-13 08:53:09'),(20,'Buen día Mariana, como le comenté en el otro reclamo que realizó, la pala cargadora volvió a sufrir roturas, y este inconveniente impide la recolección que usted está necesitando. Lamentamos la demora, pero en cuanto esta situación mejore, van a estar pasando por su domicilio. Mil disculpas y gracias.',95,'2018-06-19 09:10:35'),(21,'Buen día Horacio, debido a que la pala cargadora se encuentra en reparación y se está esperando que traigan otra pala cargadora afectada en tareas de rurales, para poder hacer factible su solicitud, no se puede realizar su reclamo. Lamentamos la demora, pero en cuanto se cuente con la maquinaria, van a pasar por su domicilio a recolectar escombros. Disculpas y gracias.',82,'2018-06-21 09:54:35'),(22,'Buen día Horacio, debido a que la pala cargadora se encuentra en reparación y se está esperando que traigan otra pala cargadora afectada en tareas de rurales, para poder hacer factible su solicitud, no se puede realizar su reclamo. Lamentamos la demora, pero en cuanto se cuente con la maquinaria, van a pasar por su domicilio a recolectar escombros. Disculpas y gracias.',66,'2018-06-21 09:55:05'),(23,'Buen día Natalia, debido a que la pala cargadora se encuentra en reparación y se está esperando que traigan otra pala cargadora afectada en tareas de rurales, para poder hacer factible su solicitud, no se puede realizar su reclamo. Lamentamos la demora, pero en cuanto se cuente con la maquinaria, van a pasar por su domicilio a recolectar escombros. Disculpas y gracias.',65,'2018-06-21 09:55:34'),(24,'Buen día Graciela, debido a que hay muchas prioridades en reparación de calles, arreglos de cordones cuneta y rellenos de calles, su solicitud se va a postergar hasta nuevo aviso. Lamentamos la demora pero en este momento, la maquinaria y trabajadores, se encuentran afectados en las tareas arriba descritas. Gracias y saludos.',75,'2018-06-21 10:09:50'),(25,'Buen día Mariana, le solicitamos se acerque a la Delegación para explicarle el costo de la recolección de ramas por tratarse de ramas del patio interno de su propiedad y no ramas de poda. La esperamos y muchas gracias.',129,'2018-06-21 10:30:42'),(26,'Buen día Mariana, le solicitamos se acerque a la Delegación para explicarle el costo de la recolección de ramas por tratarse de ramas del patio interno de su propiedad y no ramas de poda. La esperamos y muchas gracias.',95,'2018-06-21 10:43:50'),(27,'Buen día Yésica, debido a que la máquina se encuentra afectada a otras tareas, su solicitud se va a postergar hasta nuevo aviso. Disculpas y gracias .',124,'2018-06-21 10:46:28'),(28,'Buen día Paulo, de acuerdo a la cantidad de escombros a retirar, le solicitamos que se acerque a la delegación así le informamos el costo del trabajo a realizar. Muchas gracias.',145,'2018-06-25 08:24:42'),(29,'Buen día Luis, debido a que las máquinas estuvieron realizaron trabajos en otros caminos, aún no han podido pasar por la dirección que Ud. brindó. En unos días, estarán realizando el trabajo de reparación de camino. Gracias y disculpas por la demora.',162,'2018-07-12 08:17:33'),(30,'Buen día Roberto, ya hemos derivado su pedido de recolección de ramas, a la dirección que ahora sí nos figura en el sistema. Le pedimos disculpas. Gracias.',177,'2018-07-12 08:25:21'),(31,'Por cuestiones climáticas, se posterga la recolección de ramas hasta la próxima semana. Disculpas y gracias.',177,'2018-07-20 10:57:33'),(32,'Por cuestiones climáticas, se posterga la recolección de ramas hasta la próxima semana. Disculpas y gracias.',176,'2018-07-20 10:58:52'),(33,'Señora vecina, de acuerdo a su solicitud de arreglo de calle, le comunicamos que para poder realizar el trabajo correspondiente, necesitamos contar con el aval del ingeniero, quien determina como se debe realiza la labor. Lamentamos la demora pero en cuanto contemos con el procedimiento adecuado por parte del ingeniero, se procede al arreglo de calle. Gracias.',204,'2018-08-03 12:12:45'),(34,'Señora vecina, de acuerdo a su solicitud de arreglo de calle, le comunicamos que para poder realizar el trabajo correspondiente, necesitamos contar con el aval del ingeniero, quien determina como se debe realiza la labor. Lamentamos la demora pero en cuanto contemos con el procedimiento adecuado por parte del ingeniero, se procede al arreglo de calle. Gracias.',207,'2018-08-03 12:13:53'),(35,'Buen día, en esta semana van a realizar el trabajo de arreglo del camino. Gracias y disculpe por la demora.',162,'2018-08-07 08:28:24'),(36,'Buen día, de acuerdo a que las máquinas se encuentran trabajando en recolección de ramas, su solicitud de recolección de escombros se posterga hasta la próxima semana. Gracias y disculpe las molestias.',224,'2018-08-08 07:48:59'),(37,'Buen día, de acuerdo a que las máquinas se encuentran trabajando en recolección de ramas, su solicitud de recolección de escombros se posterga hasta la próxima semana. Gracias y disculpe las molestias.',225,'2018-08-08 07:49:10'),(38,'Buen día, su pedido se va a estar realizando esta semana. Gracias y disculpe pro la demora pero las máquinas se encontraban afectadas a otros barrios, realizando relleno y emparejamiento de calles.',75,'2018-08-08 09:48:09'),(39,'Buen día, su solicitud se encuentra en trámite. Disculpe las molestias y demora. Gracias.',94,'2018-08-08 09:49:05'),(40,'Buen día, su solicitud se encuentra en trámite. Disculpe las molestias y demora. Gracias.',171,'2018-08-08 09:49:14'),(41,'Buen día, su solicitud se encuentra en trámite. Disculpe las molestias y demora. Gracias.',176,'2018-08-08 09:49:24'),(42,'Buenos días Fabián, la recolección de residuos domiciliaria de su barrio, será los días lunes, miércoles y viernes por la tarde. Gracias.',196,'2018-08-13 07:53:44'),(43,'Buen día Graciela, se están realizando arreglos en calles. En estos días, estarán reparando la calle en la que usted solicitó. Gracias.',75,'2018-08-17 08:54:31'),(44,'Buen día Graciela, se continúan realizando arreglos de calles de distintos barrios y actualmente, trabajando en La Salada. Pedimos disculpas por la demora. Le avisaremos cuándo estarían realizando el trabajo solicitado por usted. Gracias.',75,'2018-09-19 10:48:05'),(45,'Buen día Claudia, de acuerdo a la cantidad de tierra y escombros a retirar en su domicilio, le solicitamos se acerque a nuestra delegación, a consultar el importe a abonar por dicho trabajo. Muchas gracias.',303,'2018-10-05 10:38:54'),(46,'Buen día Lorena, responsables de la delegación se acercaron a su domicilio, y se verificó que la cantidad de escombros y ramas a retirar es significativa, por lo que le solicitamos, pase por nuestra delegación a informarse el importe a abonar. Muchas gracias.',322,'2018-10-19 07:10:39'),(47,'En este momento se está trabajando en el arreglo de calles en el Barrio Matadero. Al culminar dicha obra, se procederá al arreglo de calles de su barrio. Disculpe las molestias ocasionadas. Gracias.',329,'2018-10-29 08:45:09'),(48,'En este momento se está trabajando en el arreglo de calles en el Barrio Matadero. Al culminar dicha obra, se procederá al arreglo de calles de su barrio. Disculpe las molestias ocasionadas. Gracias.',330,'2018-10-29 08:45:16'),(49,'En este momento se está trabajando en el arreglo de calles en el Barrio Matadero. Al culminar dicha obra, se procederá al arreglo de calles de su barrio. Disculpe las molestias ocasionadas. Gracias.',331,'2018-10-29 08:45:22'),(50,'En este momento se está trabajando en el arreglo de calles en el Barrio Matadero. Al culminar dicha obra, se procederá al arreglo de calles de su barrio. Disculpe las molestias ocasionadas. Gracias.',332,'2018-10-29 08:45:29');
